        pool = PoolMapping[_pool];
        emit poolAddress(address(pool));
        return address(pool);
    }

      function getMessage(uint256 _pool) public {
        pool = Pool(address(PoolMapping[_pool]));
        uint256 message = pool.getNumber();
        emit userNumber(message);

